    <div className="App">
      <Background 
        color="#23b2e3"
        language="PT"
        title="TÁ COM DÚVIDA NO TAMANHO?"
        sub="RELAXA QUE A GENTE TE AJUDA!"
        button="CLICK ME"
      />
